import dialogsReducer from "./dialogs-reducer";
import navbarReducer from "./navbar-reducer";
import profileReducer from "./profile-reducer";

let store = {
    _state: {
        dialogsPage: {
            newMessageText: '',
            dialogs: [
                { id: 1, name: 'Vasyan' },
                { id: 2, name: 'Max' },
                { id: 3, name: 'Alex' },
                { id: 4, name: 'Blabla' },

            ],

            messages: [
                { id: 1, messages: 'hi' },
                { id: 2, messages: 'hello' },
                { id: 3, messages: 'blabla' },
            ]

        },
        profilePage: {
            newPostText: 'newPostText',
            post: [
                { id: 1, messages: 'ffffff', likecount: 5 },
                { id: 2, messages: 'aaaaaaa', likecount: 15 }
            ]
        },
        navbar: {
            friends: [
                { id: 1, name: 'Vasyan', img: 'data:image/jpeg;base64,' },
                { id: 2, name: 'Max', img: 'data:image/jpeg;base64,' },
                { id: 3, name: 'Alex', img: 'data:image/jpeg;base64,' },
            ]
        }
    },
    _callSubscriber() {
        console.log('State changed');
    },
    getState() {
        return this._state;
    },
    subscribe(observer) {
        this._callSubscriber = observer;         // !pattern observer 

    },
    dispatch(action) {      //{ type : 'ADD-POST'}
        this._state.profilePage = profileReducer(this._state.profilePage, action);
        this._state.dialogsPage = dialogsReducer(this._state.dialogsPage, action);
        this._state.navbar = navbarReducer(this._state.navbar, action);
        this._callSubscriber(this._state);
    }

}
export default store;
window.store = store;